import styled from 'styled-components';

const NavigationWrapper = styled.div`

  @media(min-width: 1024px) {
    background-color: pink;
    position: absolute;
    right: 0;
    width: 200px;
  }
`;

const NavItem = styled.div`

  @media(min-width: 1024px) {
    background-color: black;
    color: white;
    font-size: 24px;
    padding: 24px;
  }
`;
export {
  NavigationWrapper,
  NavItem
};
